<script setup>
import {ref} from "vue";
import election from '../assets/elections.json'

let dialog = ref(null)
let state = ref(null)
let color = ref({
  color: null,
  winner: null
})
let selectedState = ref(
    {
      "Escrutinio": null,
      "Participacion": null,
      "Mayoria": null,
      "Total": null,
      "Escanos": [
        {"Partido": null, "Escanos": null, "Porcentaje": null, "Votos": null}

      ]
    }
)
const bluePP = 'rgb(48, 166, 223)'
const redPSOE = 'rgb(220, 18, 34)'
const blueUPN = 'rgb(33, 59, 154)'
const getDetails = (event) => {

  state.value = event.target.getAttribute('aria-label')
  if (state.value !== null) {
    const svgColor = (event.target.getAttribute('style'))
    const rgbSubString = svgColor.substring(svgColor.indexOf('rgb'), svgColor.length - 1).trim()
    let winner
    switch (rgbSubString) {
      case bluePP:

        winner = 'PP'
        break;
      case redPSOE:

        winner = 'PSOE'
        break;
      case blueUPN:

        winner = 'UPN'
        break;
      default:

    }

    color.value =
        {
          color: rgbSubString,
          name: winner

        }




    selectedState.value = election.elections[0][state.value]

    dialog.value.showModal()

  }

}

const closeDialog = (event) => {
  const dialogDimension = event.target.getBoundingClientRect();

  if (
      event.target instanceof HTMLDialogElement && // Check if the target is a dialog element
      (event.clientX < dialogDimension.left ||
          event.clientX > dialogDimension.right ||
          event.clientY < dialogDimension.top ||
          event.clientY > dialogDimension.bottom)

  ) {
    event.target.close();
  }
};
const exit=()=>{
  dialog.value.close();
}
</script>

<template>
  <dialog :style="color.color !==null ?'border-color: '+color.color : ''" @click="closeDialog" ref="dialog">
    <button :style="color.color !==null ?'background-color: '+color.color : ''"  @click="exit">Close Window</button>
    <h1>{{ state }} </h1>
    <p :style="{ color: color.color }">Ganador: {{ color.name }}</p>

    <p>Escrutinio {{ selectedState.Escrutinio }}</p>
    <p>Participacion {{ selectedState.Participacion }}</p>
    <p>Mayoria {{ selectedState.Mayoria }}</p>
    <p>Total {{ selectedState.Total }}</p>
    <ol>
      <li  v-for="e in selectedState.Escanos">      <span>Partido:</span> {{ e.Partido }}     <span>Escanos:</span> {{ e.Escanos }}     <span>%:</span> {{ e.Porcentaje }}     <span>Votos:</span> {{ e.Votos }}
      </li>
    </ol>

